import React from 'react';
import ReactDOM from 'react-dom';

const name = "AR";
const currDate = new Date().toLocaleDateString();
const currTime = new Date().toLocaleTimeString();

ReactDOM.render( 
    <> 
        <h1> Name: { name } </h1> 
        <p>Date: { currDate }</p>
        <p>Time: { currTime }</p>
     </> , document.getElementById("root"));
